uch as restaurants, cafes, and convenience store. It\'s very convenient to go there so I go to the park and enjoy the picnic with my freinds every weekend.',48,247),(461,'https://jaeyeong-s3.s3.ap-northeast-2.amazonaws.com/cfeb666f-7eb1-413b-9ea7-b929b847fbaa.webm','2022-08-17 22:30:18.268000','I live in a studio by my self. I have lived in this studio for 3 years. There is the bedroom, the kitchen and the bathroom.\nIn the bedroom, there are various types of furniture. First, there is the desk, the chair and the fridge right in front of that. The bedroom is connected to the kitchen. In the kitchen, there is the microwave and the washer. In the bathroom, there is the mirror and the bathtub. My studio is the best place to get some rest. I can wind down and relax when i get home. Also, I can do whatever I want. I can listen to music, read books and drink beers. So, this is what my studio looks like.',74,247),(462,'https://jaeyeong-s3.s3.ap-northeast-2.amazonaws.com/dbe59369-521a-4661-81a7-7c447d8fa2d6.webm','2022-08-17 22:35:07.410000','',12,9),(464,'https://jaeyeong-s3.s3.ap-northeast-2.amazonaws.com/5364b8ae-87cc-48ef-88c0-afa518f745ff.webm','2022-08-17 22:35:35.770000','',19,9),(465,'https://jaeyeong-s3.s3.ap-northeast-2.amazonaws.com/4b85b1ea-c2e7-4e3d-b404-448410b541bb.webm','2022-08-17 22:36:56.363000','I like to play basketball on weekends. The place I like to play is in Goyang Gym. I prefer playing there because the various sports facilities. Also, it is well managed because it is used by athletes. I usually play basketball with the members of my club. It is a good opportunity to socialize and exercise.',156,247),(483,'https://jaeyeong-s3.s3.ap-northeast-2.amazonaws.com/a2e77163-aa1c-494c-9cfa-3682bfbbc4aa.webm','2022-08-17 22:47:15.772000','Script code. ',340,10),(484,'https://jaeyeong-s3.s3.ap-northeast-2.amazonaws.com/84264035-27ed-4da4-bb8d-f2beec82edc0.webm','2022-08-17 22:47:29.666000','',28,9),(486,'https://jaeyeong-s3.s3.ap-northeast-2.amazonaws.com/5d